This is the conclusion of Wolverine v3, which was renamed Dark Wolverine for the last 15 issues, as well as the the following series Daken - Dark Wolverine (complete run, 1-23) and the Dark Reign special that kind of leads into the series. Mostly this is the story of Daken, and not really Wolverine, but it's a cool tale nonetheless and functions as an introduction on the character to the wider Marvel canvas. Daken is arrogant, vain, cruel and exceptionally violent, and Woverine's failings with him continue to haunt Logan for some time (and reach a resolution in a different comic, Rick Remender's Uncanny X-Force v1). These volumes take us through the Siege event and crisscross with Wolverine stories as well.

I have numbered the folders in the correct reading order; Dark Reign into Dark Wolverine into Daken. The DR one-shot is in Digital-HD via Monafekk Empire; DW is all HQ Minuteman scans (which have not been torrented before) except issues 88 and 89 which are digital MM. They are the only two in digital of the run. Daken is all digital thanks to ZoneKing-Empire. Massive thumbs up to the groups as always, and please seed - enjoy! :-)
